// MedicalRequestForm.jsx - Componente Principal
import React, { useState, useEffect } from 'react';
import LocationStep from './components/LocationStep';
import MedicationStep from './components/MedicationStep';
import PriorityStep from './components/PriorityStep';
import SummaryStep from './components/SummaryStep';
import { useFormData } from './hooks/useFormData';
import { useSubmitHandler } from './hooks/useSubmitHandler';
import '../css/Solicitud.css';

const MedicalRequestForm = () => {
  const [currentStep, setCurrentStep] = useState(1);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [userInfo, setUserInfo] = useState(null);

  const {
    location,
    setLocation,
    selectedMedications,
    setSelectedMedications,
    priority,
    setPriority,
    medications,
    availableDrones,
    handleMedicationSelect,
    updateMedicationQuantity,
    removeMedication
  } = useFormData();

  const { handleSubmit } = useSubmitHandler({
    userInfo,
    location,
    selectedMedications,
    priority,
    availableDrones,
    setLoading,
    setError,
    setCurrentStep,
    setLocation,
    setSelectedMedications,
    setPriority
  });

  // Verificar autenticación del usuario
  useEffect(() => {
    const checkUserAuth = () => {
      try {
        const userId = localStorage.getItem('userId');
        const userEmail = localStorage.getItem('email');
        const userName = localStorage.getItem('nombre');
        const userRole = localStorage.getItem('rol');

        if (!userId || !userEmail) {
          setError('Usuario no autenticado. Por favor, inicia sesión.');
          return;
        }

        setUserInfo({
          id: parseInt(userId),
          email: userEmail,
          name: userName,
          role: userRole
        });
      } catch (storageError) {
        console.error('Error accediendo a localStorage:', storageError);
        setError('Error de sesión. Recarga la página e inicia sesión nuevamente.');
      }
    };

    checkUserAuth();
  }, []);

  const nextStep = () => {
    if (currentStep < 4) {
      setCurrentStep(currentStep + 1);
    }
  };

  const prevStep = () => {
    if (currentStep > 1) {
      setCurrentStep(currentStep - 1);
    }
  };

  const canProceedStep1 = location.region && location.address && location.confirmed;
  const canProceedStep2 = selectedMedications.length > 0;
  const canProceedStep3 = priority;

  // Mostrar error si no está autenticado
  if (!userInfo) {
    return (
      <div className="medical-form-container">
        <div className="form-container">
          <div className="error-message">
            ⚠️ Usuario no autenticado. Por favor, inicia sesión para continuar.
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="medical-form-container">
      <div className="form-container">
        <div className="header">
          <h1 className="title">Solicitud de Medicamentos</h1>
          <div className="user-info" style={{marginBottom: '10px', padding: '10px', backgroundColor: '#f0f8ff', borderRadius: '5px'}}>
            👤 Bienvenido, <strong>{userInfo.name}</strong> | 📧 {userInfo.email}
          </div>
          <div className="progress-bar">
            {[1, 2, 3, 4].map(step => (
              <div
                key={step}
                className={`progress-step ${step <= currentStep ? 'active' : ''}`}
              >
                {step}
              </div>
            ))}
          </div>
        </div>

        {error && (
          <div className="error-message">
            {error}
          </div>
        )}

        {/* Renderizar el paso actual */}
        {currentStep === 1 && (
          <Localizacion 
            location={location}
            setLocation={setLocation}
            loading={loading}
            setLoading={setLoading}
            error={error}
            setError={setError}
            onNext={nextStep}
            canProceed={canProceedStep1}
          />
        )}

        {currentStep === 2 && (
          <MedicationStep
            medications={medications}
            selectedMedications={selectedMedications}
            onMedicationSelect={handleMedicationSelect}
            onUpdateQuantity={updateMedicationQuantity}
            onRemoveMedication={removeMedication}
            onNext={nextStep}
            onPrev={prevStep}
            canProceed={canProceedStep2}
          />
        )}

        {currentStep === 3 && (
          <PriorityStep
            priority={priority}
            setPriority={setPriority}
            onNext={nextStep}
            onPrev={prevStep}
            canProceed={canProceedStep3}
          />
        )}

        {currentStep === 4 && (
          <SummaryStep
            userInfo={userInfo}
            location={location}
            selectedMedications={selectedMedications}
            priority={priority}
            loading={loading}
            onSubmit={handleSubmit}
            onPrev={prevStep}
          />
        )}
      </div>
    </div>
  );
};

export default MedicalRequestForm;
